import React, { useEffect } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";


interface NavigationI {
    title:string,
    path:string  ,
    com:any
}

interface NavigationProps{
    data:NavigationI[];
}


const Navigation = ()=> {
    return (
        <div>
            <ul>
                <li>
                    <Link to='/'>Dashboard</Link>
                    <Link to='/reports'>Reports</Link>
                </li>
            </ul>
        </div>
    )
}

export default Navigation;
